import React from "react";
import { Grid } from "semantic-ui-react";
import CustomUser from "./cards/customUser";
import UserForm from "components/forms/userForm";
import { connect, useSelector } from "react-redux";
import Header from "./Header";
import { getUserElements } from "store/selectors";
import DefaultUser from "./cards/defaultUser";
import Submit from "./Submit";

const Landing = () => {
  const user = useSelector(getUserElements);
  return (
    <React.Fragment>
      <div style={{ margin: "0px 15%" }}>
        <Grid columns={1} divided stackable>
          <Grid.Column>
            <Header />
            {user.type === "Custom" ? (
              <CustomUser {...user} />
            ) : (
              <DefaultUser />
            )}
          </Grid.Column>
          {user.type === "Custom" ? (
            <React.Fragment>
              <Grid.Column>
                <UserForm />
              </Grid.Column>
            </React.Fragment>
          ) : null}
          <Submit />
        </Grid>
      </div>
    </React.Fragment>
  );
};

export default connect(null, null)(Landing);
